import React from 'react';
import About from '../components/About';

/**
 * About Page Component
 * Dedicated page for personal story, background, and detailed information
 */
const AboutPage = () => {
  return (
    <div className="page page--about">
      <About />
    </div>
  );
};

export default AboutPage;
